    "# Bellabeat Case Study\n",
    "\n",
    "<h3>How Can a Wellness Technology Company Play It Smart?</h3>\n",
    "\n",
    "\n",
    "R - [FitBit Fitness Tracker Data](https:https://www.kaggle.com/datasets/arashnic/fitbit)"
