    "\n",
    "![Unknown-2.png](attachment:cea75a0e-cfd9-4024-afba-a48e8d70c8b9.png)\n",
    "\n",
    "# Summary\n",
    "\n",
    "# Company Background\n",
    "<p> Bellabeat is a tech-driven wellness company for women founded in 2013, that manufactures health-focused smart products that are beautifully designed to inform and inspire women around the world. Bellabeat technology is developed to Collect data on various health activities, sleep, stress, and reproductive health, which has allowed women to be empowered with the knowledge about their own health and habits. </p>\n",
    "\n",
    "# Ask\n",
    "\n",
    "<h3>Business Task</h3>\n",
    "<p>As a junior data analyst working on the marketing analyst team at Bellabeat, I have been asked to analyze data from non-Bellabeat(FitBit) smart devices usage, in order to gain insight into how consumers are using these smart devices. These insights will help guide the marketing strategy for the company.</p>\n",
    "\n",
    "<h3>Key Stakeholders</h3>\n",
    "\n",
    "<ul><strong>Urška Sršen:</strong> Bellabeat’s co-founder and Chief Creative Officer</ul>\n",
    "\n",
    "<ul><strong>Sando Mur:</strong> Mathematician and Bellabeat’s co-founder; key member of the Bellabeat executive team</ul>\n",
    "\n",
    "<ul><strong>Marketing analytics team:</strong> A team of data analysts responsible for guiding Bellabeat’s marketing strategy.</ul>\n",
    "\n",
    "# Prepare\n",
    "\n",
    "<h3>Data Source</h3>\n",
    "\n",
    "The data provided to us by Bellabeat's cofounder is the FitBit Fitness Tracker Dataset, which is a public domain made available through Mobius. The dataset is also available on Kaggle:  [https://kaggle.com/arashnic/fitbit](https://kaggle.com/arashnic/fitbit) \n",
    "\n",
    "<h3>Is the Data ROCCC(Reliable, Original, Comprehensive, Current, and Cited)?</h3>\n",
    "<ul><strong>Reliable- </strong>- The dataset only has 30 participants with no additional information on gender, age, or lifestyle.</ul>\n",
    "<ul><strong> Original-</strong> - The data was collected from Amazon Mechanical Turk.</ul>\n",
    "<ul><strong>Comprehensive-</strong>There is some missing information due to all users not wearing FitBit for 30 days</ul>\n",
    "<ul><strong>Current-</strong>The data was collected in 2016.  Since there have been many changes since then, it might be useful to gather more recent data for future projects</ul>\n",
    "<ul><strong>Cited-</strong> Unknown since this was 3rd party data</ul>\n",
    "\n",
    "\n",
    "# Proceess\n",
    "\n",
    "<p> Due to the size of the data sets, I will be using R Programming language to create data visualizations to share with stakeholders </p>\n",
    "\n",
    "<h3> Installing R Packages </h3>\n",
    "\n",
    "<p> In order to process the data in R, we will need to install the necessary packages </p>"
   ]
  },
